import { useState } from "react";
function App() {
  let [number, myNumber] = useState(0);

  function increaseBtn() {
    myNumber(number + 1);
  }
  return (
    <>
    
      <button onClick={increaseBtn}>click</button>
    </>
  );
}

export default App;
